import React, { useState } from 'react';
import styled from 'styled-components';

const Div=styled.div`
  padding: 0 4px;
  height:122px;
`
const Img=styled.img`
  object-fit:cover;
  width:56px;
  height:56px;
  border-radius:50%;
  margin: 0 auto;
  border:solid 0.5 gray;
`
const Check=styled.span`
  width:66px;
  height:66px;
  border:solid 3px transparent;
  background-image: linear-gradient(#fff, #fff), linear-gradient(to right, #FC466B, purple);
  background-origin: border-box;
  background-clip: content-box, border-box;
  overflow:hidden;
  border-radius:50%;
  display:flex;
  align-items:center;
`
const NotCheck=styled.span`
  width:66px;
  height:66px;
`
const Name=styled.div`
  font-size:12px;
  color:#262626;
  overflow:hidden;
  margin-top:5px;
  text-overflow:ellipsis;
  postion:absolute;
  top:50px;
`
function StoryEle() {
  const [check,setCheck]=useState(false)
  function onCheck(){
    setCheck(true)
  }
  return (
   <Div>
      {check?
      <Img src='images/activeStatus/photo.png'/>:
      <Check>
        <Img onClick={onCheck} src='images/activeStatus/photo.png'/>
      </Check>
      }
      <Name>growing_beomeo</Name>
   </Div>
  );
}

export default StoryEle;
